import { useState } from "react";

export default function Guess() {
  const [num, setNum] = useState(0);
  function plusClick() {
    setNum(num + 1);
  }
  function minusClick() {
    setNum(num - 1);
  }
  return;
  <>
    <button onClick={plusClick}>{num}</button>;
    <button onClick={minusClick}>{num}</button>;
  </>;
}
